      <div className="tour-info">
        <h4>{name}</h4>
        <h4 className="tour-price">{price}</h4>
      </div>
      <p>{info}</p>
      <button className="delete-btn">Change functionality</button>
    </footer>
    <img src={image} alt={name}/>

  </article>);
};

